import React from 'react';
import Login from './Login';
import Mealboard from './Mealboard';
import Mealboard2 from './Mealboard2';
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Link, NavLink, Switch } from 'react-router-dom';



function App() {

  return (
    <Router>
    <Navbar />
    <Login />
    <div className="App">
      <h2>Plan your Mealboard!</h2>

      <NavLink exact activeClassName="Active" to="/mealboard">Mealboard</NavLink>

      <NavLink exact activeClassName="Active" to="/mealboardalt">Mealboard 2</NavLink>

      <hr />

      <Switch>
        <Route path ="/mealboard" component={Mealboard} />
        <Route path="/"><Mealboard2 /></Route>
      </Switch>
    </div>
  </Router>
  );
}

export default App;
